def convert_to_meters(row):
    depth = row['sample_depth']
    unit = row['sample_depth_units']

    if pd.isna(depth):
        return np.nan
    if unit in ['meter', 'meters', 'm']:
        return depth
    elif unit in ['foot', 'feet', 'ft']:
        return depth * 0.3048
    elif unit in ['inch', 'inches', 'in']:
        return depth * 0.0254
    else:
        return np.nan  # unknown or missing unit

# Apply conversion
